create table breeds_spells
(
    Id           smallint unsigned auto_increment
        primary key,
    BreedId      tinyint unsigned  null,
    Spell        smallint unsigned null,
    ObtainLevel  tinyint unsigned  null,
    VariantId    smallint          null,
    VariantLevel tinyint unsigned  null,
    Active       varchar(255)      null
)
    collate = utf8mb4_general_ci;

